import React, { useState } from "react";
import "./Qua.scss";
import Exp from "./Expand.png";

export const Quations = () => {
  const [isActive, setIsActive] = useState(false);

  const toggleAnswer = () => {
    setIsActive(!isActive);
  };

  return (
    <div className="Quations">
      <div className="Quations-Title">Часто задаваемые вопросы</div>
      <div className="Quations">
        <div className="Quation">
          <button className="Quastion-statement-basic" onClick={toggleAnswer}>
            <div className="Simvol">-</div>
            <div className="Quastion-Statement">
              Сколько раз в год можно обратиться к терапевту или педиатру по
              данной программе?
            </div>
            <div className="img">
              <img src={Exp} alt="expand icon" />
            </div>
          </button>
          <div className={`Quastion-Statement ${isActive ? "active" : ""}`}>
            Количество обращений не ограничено в течение всего срока действия
            договора.
          </div>
        </div>
      </div>
    </div>
  );
};
